import React from 'react';
import './App.css';
import Calendar from "react-material-ui-calendar";


function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Calendar
        generalStyle={{
          maxWidth: "100%",
          margin: "0 auto",
          backgroundColor: "rgba(0,0,0,1)",
          height: "100%",
          overflow: "auto"
        }}
        // selection={this.callBackFunction}
        mode="day"/>
        <p>
          TKC Class Schedule: First Class Scheduler
        </p>
      </header>
    </div>
  );
}

export default App;
